Page=new Array();Page[0]=new Array("I fönstret Papper/Utmatning kan du välja grundläggande inställningar för de flesta utskriftsjobb.","Jobbtyp","Papper","Dubbelsidig utskrift","Om skrivaren har en funktion för dubbelsidig utskrift kan du ange inställningar för att automatiskt skriva ut på båda sidor av papperet.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Vissa papperstyper, pappersformat och ytvikter skrivs inte ut automatiskt på båda sidor. Mer information finns i dokumentationen till skrivaren.","För dubbelsidig utskrift:","Klicka på pilarna bredvid Dubbelsidig utskrift i fönstret Papper/Utmatning och välj ett alternativ.","Enkelsidig utskrift: Skriver ut på materialets ena sida. Använd alternativet när du skriver ut på stordior, kuvert, etiketter och annat material som inte kan skrivas ut på båda sidorna.","Dubbelsidig utskrift: Skriver ut på båda sidorna av papperet så att det kan bindas längs långsidan.","Dubbelsidig utskrift, vänd vid kortsida: Skriver ut på båda sidorna av papperet så att det kan bindas längs kortsidan.","Se även: ","Miljösmarta inställningar","Utskriftskvalitet","Använd Utskriftskvalitet när du vill bestämma utskriftens färger, registrering, skärpa och likhet med originalet.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här väljer du utskriftskvalitet:","Klicka på pilarna bredvid Utskriftskvalitet i fönstret Papper/Utmatning och välj ett alternativ.","Utökad ger den bästa bildkvaliteten, 525 x 450 dpi, för CAD-program och hög detaljskärpa. Linjer och kanter förstärks så att de ger ett jämnt intryck. Svarta och mörka färger förstärks.","Snabb färg eller Hög hastighet: Det snabbaste fullfärgsläget, där utskriften görs med 188 x 400 dpi. Använd detta läge när du har många bilder och för att förhandsgranska jobbet. Snabb färg ger snabbt granskningsutskrifter för brådskande jobb. Används tillsammans med papper i standardformat i magasin 1. Rekommenderas inte för dokument med liten text, fina detaljer eller stora områden med starka och täckande färger.","Högupplöst rastrering och utskrift med 525 x 400 dpi. Det ger bästa totala bildkvaliteten för detaljerade streckteckningar, t.ex. CAD-filer. Rekommenderas vid utskrift av med intensiva och mättade bilder eller foton. Utskriftsjobbet kan ta längre tid att bearbeta när det skrivs ut i detta utskriftkvalitetsläge.","Hög kvalitet: Ger skarpa linjer och detaljer. Rekommenderas för intensiva, mättade färgutskrifter.","Fotoläge ger bästa möjliga detaljskärpa och jämna färger.","Standard ger skarpa och klara utskrifter med hög hastighet och är lämpligt för svart text. Standard ger den bästa kompromissen mellan prestanda och bildkvalitet för de flesta typer av utskrifter. Med Standard skrivs raster ut med 300 x 450 dpi.","Obs! Använd alltid Standardläge vid utskrift på stordior.","Spara färgpulver: Minskar mängden färgpulver som används för utskriftsjobb. Lämpligt för utskrifter med utkastkvalitet. Utskriftens kvalitet blir lite lägre än med Standard. Spara färgpulver ger fortfarande rastrering och utskrift med 600 x 600 dpi.","Efterbehandling","Utmatningsfack","Papper/Utmatning","paper_output.html");
Page[1]=new Array("Jobbtypen avgör hur ett jobb skrivs ut. Du kan kräva ett lösenord för utskriftsjobb, lagra ett dokument på skrivaren eller ställa in en viss tidpunkt då jobbet ska skrivas ut. Det kan även skickas som fax.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Normal utskrift","Normala utskrifter sparas inte på skrivaren och kräver inget lösenord. Normal utskrift är den grundinställda jobbtypen. Använd Normal utskrift om du vill skriva ut ett jobb direkt.","Så här skriver du ut med Normal utskrift:","Klicka på pilarna bredvid Jobbtyp i fönstret Papper/Utmatning och välj Normal utskrift.","Gör andra val för utskriftsjobbet efter behov.","Klicka på Skriv ut.","Skyddad utskrift","Fördröjd utskrift","Provsats","Med Provutskrift skrivs det ut ett exemplar av en utskrift innan resterande exemplar skrivs ut. När du har granskat provutskriften kan du skriva ut resterande exemplar eller ta bort dem via kontrollpanelen.","Så här skriver du ut med Provutskrift:","Klicka på pilarna bredvid Jobbtyp i fönstret Papper/Utmatning och välj Provutskrift.","Klicka på Skriv ut. Ett korrekturexemplar skrivs ut.","Om du är nöjd med korrekturexemplaret skriver du ut resten av kopiorna från skrivarens kontrollpanel.","Se även: ","Miljösmarta inställningar","Sparat jobb/Spara filen i mapp","Privat utskrift","Klicka på pilarna bredvid Jobbtyp i fönstret Papper/Utmatning och välj Privat utskrift.","Klicka på OK.","Klicka på Skriv ut.","Korrekturutskrift","Skriv ut med","Fax","Jobbtyp","job_type.html");
Page[2]=new Array("Använd Skyddad utskrift när du behöver skriva ut känslig eller konfidentiell information. När du har skickat utskriften behålls den på skrivaren tills du anger ditt lösenord på kontrollpanelen.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här skriver du ut med Skyddad utskrift:","Klicka på pilarna bredvid Jobbtyp i fönstret Papper/Utmatning och välj Skyddad utskrift.","Skriv och upprepa en lösenkod på 4&#8211;10 siffror i de avsedda fälten. En Skyddad utskrift skrivs inte ut förrän du anger lösenordet på kontrollpanelen.","Skriv lösenordet en gång till i fältet Bekräfta lösenord.","Klicka på OK.","Klicka på Skriv ut.","Skriv ut jobbet genom att ange koden på skrivarens kontrollpanel.","Ställa in Skyddad utskrift","secure_print.html");
Page[3]=new Array("Använd Fördröjd utskrift när jobbet ska skrivas ut vid en viss tidpunkt. Exempel: Om du har ett stort utskriftsjobb, kan du ställa in det på utskrift efter arbetstid.","Funktionen Fördröjd utskrift omfattar en 24-timmarsperiod med början när du skickar jobbet till skrivaren. Om du skickar utskriften efter den inställda utskriftstiden, sker utskriften vid den schemalagda tidpunkten inom de följande 24 timmarna. Exempel: Om du ställer in utskriftstiden på 4:30 PM men skickar jobbet 4:31 PM, skrivs det ut 4:30 påföljande dag.","Fördröjningar i nätverket eller utskriftskön kan göra att utskriftsjobbet kommer till skrivaren efter den inställda tiden. Fördröjningar kan också inträffa när det föreligger en skillnad mellan skrivarens och datorns klocktid. I så fall skrivs jobbet ut omedelbart.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här skriver du ut med fördröjd utskrift:","Klicka på pilarna bredvid Jobbtyp i fönstret Papper/Utmatning och välj Fördröjd utskrift.","Ställ in tiden genom att klicka på pilarna och välja timme och minuter.","Klicka på OK.","Klicka på Skriv ut.","Ställa in Fördröjd utskrift","delay_print.html");
