Page[17]=new Array("På den här sidan kan du ändra skrivarens sätt att hantera fax. Du kan exempelvis begära utskrift av bekräftelsesida eller faxsändning vid viss tid.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här använder du faxalternativ:","Klicka på pilarna bredvid Bekräftelse i fönstret Faxalternativ och ange ett alternativ.","Skriv inte ut en bekräftelsesida: Anger att bekräftelsesida inte ska skrivas ut.","Skriva ut en bekräftelsesida: Anger att bekräftelsesida ska skrivas ut.","Skicka till e-post: Anger att skrivaren ska skicka bekräftelsesidan till e-postadressen.","Välj önskad hastighet bredvid Sändningshastighet.","Sändningshastighet väljer lämplig faxsändningshastighet i kilobit per sekund (kbps) eller bitar per sekund (bps). Om du bor i ett område där telefonlinjerna inte klarar av fax-/dataöverföring med hög hastighet, bör du välja en lägre sändningshastighet. En lägre sändningshastighet minskar risken för överföringsfel.","Välj ett alternativ bredvid Faxupplösning.","Faxupplösning påverkar mängden detaljer som återges vid faxsändningen. Faxsändningar med högre upplösning tar upp mer minne och tar längre tid att sända.","Obs! Om den enhet som tar emot faxet inte stöder den valda upplösningen, ändrar den sändande enheten upplösningen så att den stämmer med kapaciteten hos den mottagande enheten.","Standard: Används för maskin&#8209;genererad text.","Fin: Används för linjeritningar, mindre text och handskriven text.","Superfin: Används för mindre text, ritningar och bilder med lägre upplösning.","Ultrafin: Används för foton och tunna linjeritningar.","I rutan Sändningstid väljer du Skicka nu eller Skicka klockan.","Välj tiden då faxet ska sändas. Du kan fördröja sändningen i upp till 24 timmar.","Med Skicka nu skickas faxet omedelbart.","Ange högst fyra siffror bredvid Uppringingsalternativ.","Under Kreditkort skriver du högst 16 siffror.","Obs! Kreditkortsnumret anges inte på kvittenser/bekräftelser.","Klicka på OK.","Faxalternativ","fax_options.html");
