Page[21]=new Array("Med Annan typ kan du välja typ av papper för jobbet.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Om du väljer en papperstyp som inte finns i skrivaren, väntar skrivaren tills rätt papper har lagts i.","Så här väljer du papperstyp:","Klicka på pilarna bredvid Papper i fönstret Papper/Utmatning och välj Annan typ.","Gör något av följande:","Om du vill använda skrivarens grundinställda papperstyp väljer du Skrivarens grundinställda typ. ","Välj en papperstyp i listan. Om administratören har angett egna papperstyper för skrivaren visas de i listan.","Om du vill välja ett magasin med godtycklig färg, välj Välj automatiskt.","Välj alternativ för Flikpapper/Flikpapper i kartong.","Papperstyp","other_type.html");
