Page[36]=new Array("Med Block kan du skapa block av enkelarksformulär, så att varje formulär kan rivas av. Det vanligaste är att ett block har ett bakre omslag i kartong och är limbundet i överkanten.","Så här skriver du ut block:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Block.","Välj ett alternativ bredvid Block:","Har inaktiverats: Inaktiverar funktionen Skapa block.","Har aktiverats: Aktiverar blockutskrift.","Välj ett av följande alternativ i Antal block:","Ange antalet block som ska skrivas ut.","Om du vill använda skrivarens grundinställningar, välj Skrivarens grundinställda typ.","Välj ett av följande alternativ i Ark per block:","Ange antalet sidor för varje block.","Om du vill använda skrivarens grundinställningar, välj Skrivarens grundinställda typ.","Välj som Bakre omslag typen av bakre omslag för blocken.","Välj alternativ för Papper.","Annatformat: Här kan du ställa in pappersformat eller skapa ett eget format.","Annan färg: Här kan du välja färger från en lista eller egna färger som administratören anger.","Annan typ: Här kan du välja papperstyp eller en egen papperstyp som administratören anger.","Klicka på OK.","Skapa block","pads.html");
Page[37]=new Array("Med limbindaren kan du binda en utskrift så att den blir en pocketbok. Den viker ett omslag runt boken och limmar fast det. Du kan också beskära boken till önskat format.","Obs! ","Alternativet visas när en lämplig efterbehandlare har installerats på skrivaren. Det visas inte om omslag, häftning, hålning, bindning, falsning eller häftesframställning har valts.","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här använder du Limbindaren:","Klicka på pilarna bredvid Efterbehandling i fönstret Papper/Utmatning och välj Limbindning.","Välj ett av alternativen i listan Limbindning.","Stående - vänster: Stående orientering och bindning i vänstra kanten.","Stående - höger: Stående orientering och bindning i högra kanten.","Liggande - överkant: Liggande orientering och bindning i överkanten.","Välj bland följande alternativ i listan Omslag för att välja papper för omslaget.","Annatformat: Här kan du ställa in pappersformat eller skapa ett eget format.","Annan färg: Här kan du välja färger från en lista eller egna färger som administratören anger.","Annan typ: Här kan du välja papperstyp eller en egen papperstyp som administratören anger.","Välj efter magasin: Du kan välja ett magasin för utskrift.","Välj en Position för omslag.","Klicka på menyn under Omslag och ett av alternativen för att välja utskriftsinställningar för omslaget.","Tomma eller förtryckta: Tomt eller förtryckt papper kan användas för omslaget.","Tryckt: Omslaget skrivs ut på det papper du väljer.","Klicka på Beskärning och välj ett alternativ.","Ingen beskärning lämnar arken obeskurna.","Framkant eller Framsida: Beskär den kant som är motstående själva limningskanten.","Utfallande aktiverar Beskuret format, där du kan välja slutformatet. Med den här funktionen kan du låta sidbilden sträcka sig ända till kanten på papperet.","När du ska välja ett beskärningsformat, klicka på Beskuret format och välj format i en lista eller Eget.","Om du vill justera beskärningen av utskriftens kanter klickar du på Justera beskärning.","Klicka på OK.","Limbindare","perfect_binder.html");
