Page[39]=new Array("Så här justerar du positionen för omslag:","I fönstret Position för omslag justerar du inställningarna för bokblock efter behov.","Centrerat: Justerar bokblocket till höger eller vänster i förhållande till omslaget.","Side (Sidojustering): Justerar bokblocket upp eller ned i förhållande till omslaget.","Klicka på OK.","Position för omslag","cover_position.html");
Page[40]=new Array("Så här justerar du beskärningen:","Ange beskärningsjusteringar i fönstret Justera beskärning efter behov.","Vertikal position: Beskär bokblocket vertikalt.","Rotation överkant: För finjustering av kniven för överkanten.","Rotation framkant: För finjustering av kniven för framkanten. Med den här inställningen passas bokens främre kant in parallellt med bindningskanten.","Rotation underkant: För finjustering av kniven för underkanten.","Klicka på OK.","Justera beskärning","trimming_adjustments.html");
Page[41]=new Array("Med funktionen Häften skrivs två dokumentsidor ut på varje sida av papperet. Sidorna placeras i ordning och vänds så att de hamnar i nummerordning när de falsas. Därefter kan sidorna häftas så att de bildar ett häfte. Kom ihåg att häfteslayouten skiljer sig från layouten på ett dokument där varje sida skrivs ut på ena sidan av papperet. Också rad- och sidbrytningar skiljer sig åt.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Med funktionen Häften kan du förminska bilden på sidan så att den kan skrivas ut på önskat pappersformat.","Så här skapar du ett häfte:","Klicka på pilarna bredvid Efterbehandling för häften i fönstret Häften och välj ett alternativ.","Ingen häftesefterbehandling eller falsning: Utskriften varken häftas eller falsas.","Häftesfals eller Vikning: Utskriften viks eller falsas längs mittlinjen.","Häftesfals och klammer eller Vikning och klammer: Utskriften viks eller falsas längs mittlinjen och två klamrar placeras i falsen så att sidorna hålls ihop.","Inaktivera Häften: Alternativ för häften tillämpas inte på utskriften. Använd detta alternativ om utskriftsjobbet redan är formaterat som ett häfte.","Om du vill att skrivaren ska skala en bild till ett nytt pappersformat klickar du på pilarna bredvid 	Skala till nytt pappersformat. Välj önskat pappersformat. Du anger ett anpassat pappersformat genom att klicka på Anpassat.","Ställ in marginaler genom att klicka på pilarna bredvid Häftesmarginaler och välja ett alternativ.","Standard förminskar sidbilden så att dokumentet skrivs ut som ett häfte på ett standardpappersformat utan bildförlust. Om skrivaren inte kan skriva ut till kanten på papperet ska du välja Standard.","Ingen skriver ut dokumentet som ett häfte utan att sidbilderna förminskas. Detta kan medföra att bilden blir avklippt om det inte går att skriva ut till kanten på papperet.","Obs! Exemplet visar två sidor med Letter-format som placerats på ett ark med Tabloid-format. I bilden till vänster används standardmarginaler. I bilden till höger används inga marginaler.","Ange fästmarginal och förskjutning efter behov.","Fästmarginal: Anger bredden (i punkter) på mittmarginalen mellan sidbilderna. Skriv punktvärdet eller ange det med hjälp av pilarna. En punkt är 0,35 mm eller 1/72 tum.","Förskjutning: Anger hur mycket sidbilderna ska förskjutas utåt (i tiondelar av en punkt). Skriv förskjutningsvärdet eller ange det med hjälp av pilarna.","Klicka på OK.","Häften","booklet_creation.html");
Page[42]=new Array("Så här väljer du utmatningsfack:","Klicka på pilarna bredvid Utmatningsfack i fönstret Papper/Utmatning och välj ett alternativ.","Du skickar utskriftsjobbet till ett utmatningsfack baserat på pappersformat och efterbehandlingsalternativ genom att välja Auto eller Auto val.","Obs! ","Beroende på övriga inställningar kan vissa magasin vara otillgängliga.","Listan visas inte om skrivaren är utrustad med ett enda utmatningsfack.","Utmatningsfack","output_destination.html");
Page[43]=new Array("Specialsidor är omslag, mellanlägg och undantagssidor som läggs till i en utskrift. Undantagssidor har andra inställningar än resten av utskriften.","Lägga till omslag","Lägga till mellanlägg","Lägga till undantag","Hantera specialsidor","Tidigare inställningar för specialsidor visas i översiktstabellen Specialsidor. I den här tabellen kan du välja en sida som du vill redigera eller ta bort. Du kan också ändra ordning på mellanlägg.","Så här redigerar, raderar eller flyttar du poster:","Välj ett av alternativen i listan över sparade sidor. Knapparna aktiveras.","Du väljer önskad åtgärd genom att klicka på knapparna.","Specialsidor","special_pages.html");
Page[44]=new Array("I fönstret Lägg till omslag kan du lägga till omslag i alla exemplar av dokumentet och ange egenskaper för omslagen. Rutan Jobbinställningar visar pappersinställningar för dokumentets huvuddel. Välj Använd jobbinställning om du vill använda jobbinställningen för en omslagsegenskap.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här lägger du till omslag:","Klicka på Lägg till omslag i fönstret Specialsidor.","Klicka på OK för att acceptera jobbets grundinställningar för alla inställningar.","Om du vill ange alternativ, välj ett alternativ för omslag i listan Omslagsalternativ.","Inga omslag avbryter tidigare inställningar för omslag.","Endast främre skriver ut den första sidan från angivet magasin. Med automatisk dubbelsidig utskrift skrivs de två första sidorna ut på omslaget.","Endast bakre skriver ut den sista sidan från angivet magasin. Med automatisk dubbelsidig utskrift skrivs de två sista sidorna ut på omslaget när antalet sidor är jämnt.","Främre och bakre: Samma skriver ut främre och bakre omslag från samma magasin.","Främre och bakre: Olika: Skriver ut främre och bakre omslag från olika magasin.","Du väljer format, färg eller typ av papper genom att klicka på pilarna bredvid Papper för främre respektive bakre omslag och välja önskade alternativ. ","Välj utskriftsalternativ för omslag.","Tomma eller förtryckta: Tomt eller förtryckt papper kan användas för omslaget.","Skriv ut på framsidan skriver ut på framsidan av omslaget.","Skriv ut på baksidan: Skriver ut på baksidan av omslaget.","Skriv ut på båda sidor: Skriver ut på båda sidor av omslaget.","Klicka på OK.","Lägg till omslag","add_covers.html");
Page[45]=new Array("Lägg till ett tomt eller förtryckt mellanlägg före den första sidan eller efter angivna sidor i dokumentet. Om du exempelvis vill infoga ett tomt färgat papper efter varje avsnitt i ett dokument ska du notera de sidnummer där avsnitten slutar. Ange sedan att det ska infogas mellanlägg efter varje angivet sidnummer.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här lägger du till ett mellanlägg:","Klicka på Lägg till mellanlägg i fönstret Specialsidor.","Välj typ av mellanlägg:","Före sida 1 infogar ett mellanlägg före sidan 1.","Efter sida/sidorna: Ett mellanlägg infogas efter sidan/sidorna du anger.","Om du väljer Efter sida/sidorna ska du ange det sidnummer som kommer före varje mellanlägg i fältet Sida/sidor.","Under Kvalitet anger du hur många mellanlägg som behövs.","Klicka på OK för att acceptera jobbets grundinställningar för alla inställningar.","Du väljer format, färg eller typ genom att klicka på pilarna bredvid Papper och välja önskade alternativ.","Klicka på OK.","Lägg till mellanlägg","add_inserts.html");
Page[46]=new Array("Välj Lägg till undantag när du vill ange undantagssidor i utskriften. Undantagssidor har andra inställningar än övriga sidor i jobbet. Du kan ange andra inställningar för pappersformat, papperstyp och pappersfärg. Du kan också ändra på vilken sida av papperet som utskriften ska ske. En utskrift kan innehålla flera undantag.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här lägger du till en undantagssida:","Klicka på Lägg till undantag i fönstret Specialsidor.","Ange under Sida/sidor vilka sidor som undantaget. Avgränsa sidorna eller sidintervallen med kommatecken. Ange sidor i ett intervall med ett bindestreck. Om du exempelvis vill ange sidorna 1, 6, 9, 10 och 11 skriver du 1, 6, 9-11.","Du väljer format, färg eller typ genom att klicka på pilarna bredvid Papper och välja önskade alternativ.","Om du väljer Flikpapper som Papperstyp ska du ange antalet flikar under Ordningsnummer.","Om du väljer Papperstyp i följd, anger du papperstypens namn och ordningsnumret.","Välj ett alternativ under Dubbelsidig utskrift om du vill ändra på vilka sidor av papperet som utskriften ska ske:","Enkelsidig utskrift skriver ut undantagssidorna på en enda sida.","Dubbelsidig utskrift skriver ut undantagssidorna på båda sidorna av papperet och vänder arken längs långsidan. Utskriften kan bindas längs papperets långsida.","Dubbelsidig utskrift, vänd längs långsida skriver ut undantagssidorna på båda sidorna av papperet och vänder arken längs kortsidan. Utskriften kan bindas längs papperets kortsida.","Du förskjuter bilden på papperet genom att välja Bildförskjutning.","Klicka på OK.","Lägg till undantag","add_exceptions.html");
Page[47]=new Array("Färgalternativ styr hur skrivaren använder färg för att framställa dokumentet.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här väljer du alternativ för Färgkorrigering:","Välj ett alternativ under Färgkorrigering i fönstret Färgalternativ.","Obs! Om du vill ändra exempelbilden väljer du ett alternativ med hjälp av pilarna under bilden.","Automatisk färg den bästa färgkorrigeringen används för text, grafik och bilder. Xerox rekommenderar det här alternativet.","Intensiv färg: ger ljusare och mer mättade färger.","Svartvitt: alla färger görs om till gråtoner, vilket ger en svartvit version av dokumentet.","Med Egna färgalternativ får du fler alternativ för anpassning av färgerna i utskriftsjobbet.","Om du vill skriva ut filnamn, utskriftskvalitetsäge och färginställningar i sidans kant, väljer du Skriv ut inställningarna på sidan. Den funktionen är praktisk när man experimenterar med färgjusteringar.","Utskrivarinställningar på sidan använder de valda färgalternativen på skärmen med förhandsgranskningsbilden.","Färgalternativ","color_options.html");
Page[48]=new Array("Med Egna färgalternativ får du fler alternativ för anpassning av färgerna i utskriftsjobbet.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Välj färg med ord","Med Välj färg med ord kan du justera färgerna genom att sätta ihop meningar med vanliga fraser som beskriver hur färgerna ska ändras.","Obs! Med Färgjustering kan du ändra färger med vanliga justeringsreglage.","Så här använder du Color By Words:","Klicka på Välj färg med ord i fältet för anpassade färgalternativ.","Du väljer den färg du vill ändra genom att klicka på pilarna bredvid Vilken färg ska jag ändra? och välja färg.","Du väljer hur mycket färgen ska ändras genom att klicka på pilarna bredvid Hur mycket ska färgen ändras? och välja ett alternativ.","Du väljer hur färgen ska ändras genom att klicka på pilarna bredvid Vilken slags ändring? och välja ett alternativ. ","Du ändrar en befintlig färgjusteringsfras genom att markera den och sedan välja nya fraser från menyerna.","Om du vill skapa en ny färgjusteringsfras klickar du på Skapa ny mening.","Du ändrar ordningen på färgjusteringsfraserna genom att markera dem och använda pilarna.","Du raderar en befintlig färgjusteringsfras genom att markera den och klicka på X.","Obs! Ordningen på meningarna bestämmer användningen av varje färgjustering.","Om du vill se en exempelbild med färgändringarna väljer du Förhandsgranskning. Om du vill se originalbilden, rensar du kryssrutan för Förhandsgranskning. Om du vill ändra exempelbilden väljer du ett alternativ med hjälp av pilarna under bilden.","Färgkorrigering","Med Färgkorrigering kan du använda förinställda färgkorrigeringslägen på utskrifterna. Med Färgkorrigering matchas skrivarens färger med färgerna på en annan enhet, t.ex. datorns bildskärm eller en tryckpress.","Så här använder du Färgkorrigering:","Klicka på pilarna i fönstret Färgkorrigering och välj ett alternativ för färgkorrigering.","Du skapar ett eget alternativ för färgkorrigering genom att välja Egen automatisk färg","Klicka på OK.","Färgjustering","Använd Färgjustering när du vill justera olika aspekter av den utskrivna färgen. Egenskaperna inbegriper ljushet, kontrast, mättnad och färgstick.","Så här gör du färgjusteringar:","Använd reglagen för att ange alternativ för ljushet, kontrast, mättnad och färgnyans.","Om du vill se en exempelbild med färgändringarna väljer du Förhandsgranskning.","Du ändrar exempelbilden genom att klicka på pilarna.","Klicka på OK.","Alternativ för Egna färger","custom_color_options.html");
Page[49]=new Array("När du väljer Anpassad automatisk färg öppnas fönstret Anpassad färgkorrigering, där du kan ange avancerade anpassade färgjusteringar.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här gör du färgjusteringar:","Gör minst ett av följande:","För Kontorsfärg, Matcha tryckpress eller Dekorfärg, gör något av följande:","Välj alternativ på menyn Text- och grafikprofil samt menyn Bildprofil.","Du ändrar ljushet, kontrast, mättnad och färgnivå genom att klicka på Fler justeringar.","För CIE-färg, gör något av följande::","Välj Använd alltid inbyggda profiler.","Med Använd alltid inbyggda profiler används dokumentets inbyggda profiler även om det innebär att färgscheman som inte är standard används. Inbäddade profiler kan ge sämre utskriftskvalitet. I samband med ovanliga data, till exempel laboratoriedata, får du bäst utskriftskvalitet med de färgscheman som ingår i den inbäddade profilen.","En inbäddad profil är ett färgrenderingsbibliotek eller CRD (Color Rendering Dictionary) som bifogas utdata från programmet och som beskriver egenskaperna hos färginformationen.","Välj Använd aldrig inbyggda profiler.","Med Använd aldrig inbyggda profiler förhindras skrivaren från att använda de inbäddade profilerna i ett dokument, vilket minskar risken för att andra färgscheman än standardscheman används.","Om du vill identifiera och använda kända färgprofiler i dokumentet klickar du på Använd automatiskt inbyggda profiler i lämpliga fall. Detta alternativ aktiverar Text- och grafik- samt Bildmenyer Välj önskade alternativ. Du kan göra fler ändringar genom att klicka på Fler justeringar.","Välj ett alternativ för Text och grafik:","Automatisk färg den bästa färgkorrigeringen används för text, grafik och bilder. Xerox rekommenderar det här alternativet.","Intensiv färg: ger ljusare och mer mättade färger.","Svartvitt kopierar endast i svartvitt. Färger i originalet konverteras till gråtoner.","Med Färgvärde görs ett försök till exakt färgmatchning. Det här läget efterliknar kontrollerade ljusförhållanden.","Perceptuell ger den bästa färgöverensstämmelsen för foton. Det är en balanserad färgmappning som inbegriper subjektiva justeringar för &quot;memory colors&quot;.","Mättnad ger den bästa färgöverensstämmelsen för grafik. Färgerna blir mer intensiva och skarpa men med mindre färgtrogenhet än med Perceptuell.","Välj ett alternativ för Bilder. En lista med alternativ finns i steget ovan.","Klicka på Fler justeringar om du vill göra ytterligare justeringar av inställningen Bilder.","Välj alternativ på menyn Text- och grafikprofil samt menyn Bildprofil.","Du ändrar ljushet, kontrast, mättnad och färgnivå genom att klicka på Fler justeringar.","För Grå färgrymd, gör något av följande::","Välj Använd RGB-färginställningar för svart.","Med Använd RGB-färginställningar för svart används grå linjer för att matcha inställningar för rött, grönt och blått (RGB) för att framställa svart. Värdena i fältet Text och grafik och fältet Bilder anges till de aktuella inställningarna på fliken Office-färg.","Välj Använd CMYK-färginställningar för svart.","Med Använd CMYK-färginställningar för svart används grå kanaler för att matcha inställningar för cyan, magenta, gult och svart. Det här alternativet ger ett resultat så nära svartvitt som möjligt. Värdena i fältet Text och grafik och fältet Bilder anges till de aktuella inställningarna på fliken Matcha tryckpress.","Välj Konfigurera svart manuellt om du vill manipulera inställningarna av svart färg. Detta alternativ aktiverar Text- och grafik- samt Bildmenyer Välj önskade alternativ. Du kan göra fler ändringar genom att klicka på Fler justeringar.","Klicka på Fler justeringar om du vill göra ytterligare justeringar av inställningen Text och grafik. Välj ett alternativ för Text och grafik:","Monokrom grafik optimeras för att ge en jämn linjär övergång från vitt till svart.","Monokroma bilder har en gammakurva som är optimerad för skarpare bilder, till exempel större kontrast.","Med Commercial används färg för utskrift på en kommersiell tryckpress.","SWOP-tryckpress (Specifications for Web Offset Printing Press) är en CMYK-baserad tryckstandard som är vanlig i USA.","Cyan, magenta, gult och svart (CMYK) som används för att framställa alla färger.","Euroscale-tryckpress överensstämmer med den europeiska FOGRA-standarden för glättat papper.","FOGRA är en färgstandard för färgåtergivning inom offsettryck och vanliga digitala utskriftstekniker.","Japan-färg är inställningen för färgkorrigering för Japan. Inställningen överensstämmer med specifikationen Japan Color 2001.","ISO bestruket är en emulering av FOGRA 27-standarden för utskrift på bestruket papper. Du kan använda inställningen även om du inte skriver ut på bestruket papper.","FOGRA är en färgstandard för färgåtergivning inom offsettryck och vanliga digitala utskriftstekniker.","ISO bestruket är en emulering av FOGRA 29-standarden för utskrift på obestruket papper.","FOGRA är en färgstandard för färgåtergivning inom offsettryck och vanliga digitala utskriftstekniker.","SNAP-tryckpress (Specifications for Non-Heatset Advertising Printing Press) är en tryckstandard för grafik.","Med sRGB-skärm emulerar skrivaren färgerna på en kalibrerad RGB-skärm, till exempel en CRT-skärm eller avancerad LCD-skärm.","Inställningar för rött, grönt och blått.","Med LCD-skärm justeras färgerna i utskriften för att efterlikna färgerna på datorns bildskärm.","Klar sRGB ger skarpare och mer mättare färger i den normala färgrymden med rött, grönt och blått.","Med Dekorfärg kombineras cyan, magenta, gult och svart för att efterlikna dekorfärgerna i en tryckpress. Välj Dekorfärg om du vill få det bredaste färgspektrat och den bästa Pantone-färgmatchningen.","Ingen tar bort alla färgkorrigeringar.","Välj ett alternativ för Bilder. En lista med alternativ finns i steget ovan. Klicka på Fler justeringar om du vill göra ytterligare justeringar av inställningen Bilder.","Välj alternativ på menyn Text- och grafikprofil samt menyn Bildprofil.","Du ändrar ljushet, kontrast, mättnad och färgnivå genom att klicka på Fler justeringar.","Om du vill återställa systemets grundinställningar klickar du på Grundinställningar","Klicka på OK.","Anpassad färgkorrigering","color_correction.html");
Page[50]=new Array("Så här gör du fler justeringar:","För önskat alternativ klicka på Fler justeringar i fönstret Anpassad färgkorrigering.","Om du vill använda färgjusteringarna från föregående fönster väljer du Använd globala justeringar.","Använd reglagen för att ange alternativ för ljushet, kontrast, mättnad och färgnyans.","Om du vill återställa systemets grundinställningar klickar du på Grundinställningar","Klicka på OK.","Fler justeringar","more_adjustments.html");
Page[51]=new Array("Med Bildalternativ kan du justera den genomgående ljusheten eller mörkheten på text och bilder i utskriften.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här anger du Bildalternativ för utskriften:","Dra reglaget åt höger om du vill göra färgerna i utskriften ljusare och åt vänster om du vill göra dem mörkare.","Dra reglaget åt höger om du vill minska kontrasten och åt vänster om du vill öka den.","Du väljer Bildalternativ genom att klicka på Bildförskjutning.","Klicka på Skriv ut.","Bildalternativ","image_options.html");
Page[52]=new Array("Med Bildläge kan du ändra placeringen av utskriftsbilden på sidan. Du kan flytta bilden längs X- och Y-axlarna på varje ark.","Så här väljer du alternativ för Bildläge:","Använd pilarna bredvid Alternativ för bildläge och välj ett alternativ.","Om du väljer Enkelsidig utskrift, välj ett alternativ för Alternativ för bildläge i fönstret Papper/Utmatning.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Oberoende: Inställningarna kan ändras manuellt.","Om du väljer Dubbelsidig utskrift, välj ett alternativ för Alternativ för bildläge i fönstret Papper/Utmatning.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Oberoende: Inställningarna kan ändras manuellt.","Spegelvänd X: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs X-axeln.","Spegelvänd Y: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs Y-axeln.","Spegelvänd båda: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs X- och Y-axeln.","Spegelvänd X, Tandem Y: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs X- och i samma riktning längs Y-axeln.","Spegelvänd Y, Tandem X: Gör att du kan flytta bilder samma avstånd simultant på båda sidor men i motsatt riktning längs Y- och i samma riktning längs X-axeln.","Tandem X: Gör att du kan flytta bilder samma avstånd simultant på båda sidor i samma riktning längs X-axeln.","Tandem Y: Gör att du kan flytta bilder samma avstånd simultant på båda sidor i samma riktning längs Y-axeln.","Tandem båda: Gör att du kan flytta bilder samma avstånd simultant på båda sidor i samma riktning längs X- och Y-axeln.","För Oberoende, gör följande:","För framsidan, ange hur mycket bilden ska förskjutas längs X- och Y-axeln.","Om baksidan är tillämplig, ange hur mycket bilden ska förskjutas längs X- och Y-axeln.","Obs! Alternativet för baksidan är bara tillgängligt om du väljer Dubbelsidig utskrift.","Om skrivaren har en funktion för dubbelsidig utskrift kan du ange inställningar för att automatiskt skriva ut på båda sidor av papperet.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Vissa papperstyper, pappersformat och ytvikter skrivs inte ut automatiskt på båda sidor. Mer information finns i dokumentationen till skrivaren.","För dubbelsidig utskrift:","Klicka på pilarna bredvid Dubbelsidig utskrift i fönstret Papper/Utmatning och välj ett alternativ.","Enkelsidig utskrift: Skriver ut på materialets ena sida. Använd alternativet när du skriver ut på stordior, kuvert, etiketter och annat material som inte kan skrivas ut på båda sidorna.","Dubbelsidig utskrift: Skriver ut på båda sidorna av papperet så att det kan bindas längs långsidan.","Dubbelsidig utskrift, vänd vid kortsida: Skriver ut på båda sidorna av papperet så att det kan bindas längs kortsidan.","Se även: ","Miljösmarta inställningar","Klicka på OK.","Bildläge","image_shift.html");
Page[53]=new Array("I fönstret Häfte/Vattenstämpel kan du välja alternativ för häftets layout och vattenstämplar.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här skriver du ut med Häfte/Vattenstämpel:","Klicka på pilarna nedanför Häften i fönstret Häfte/Vattenstämpel och välj ett alternativ.","Har aktiverats: Dokumentet skrivs ut som ett häfte. Alternativet kan användas för dokument som inte är formaterade som häften.","Har inaktiverats: Stänger av funktionen Häften. Alternativet kan användas för dokument som är formaterade som häften.","Om du vill ange ytterligare häftesalternativ aktiverar du Häften och klickar på Häftesalternativ.","Välj Rita sidkanter om du vill skriva ut en kant runt varje sida.","Välj alternativ för Vattenstämpel:","Klicka på Skriv ut.","Häfte/vattenstämpel","booklet_watermark.html");
Page[54]=new Array("Välj ett alternativ för Häften.","Du kan skala ett häfte till ett nytt format genom att klicka på pilarna bredvid Skala till nytt pappersformat och välja önskat format. Du skapar ett anpassat format genom att välja Anpassat.","Ställ in marginaler genom att klicka på pilarna bredvid Häftesmarginaler och välja ett alternativ.","Standard förminskar sidbilden så att dokumentet skrivs ut som ett häfte på ett standardpappersformat utan bildförlust.","Ingen skriver ut dokumentet som ett häfte utan att sidbilderna förminskas. Detta kan medföra att bilden blir avklippt om det inte går att skriva ut till kanten på papperet.","Ange fästmarginal och förskjutning efter behov.","Fästmarginal: Anger bredden (i punkter) på mittmarginalen mellan sidbilderna. Skriv punktvärdet eller ange det med hjälp av pilarna. En punkt är 0,35 mm eller 1/72 tum.","Förskjutning: Anger hur mycket sidbilderna ska förskjutas utåt (i tiondelar av en punkt). Skriv förskjutningsvärdet eller ange det med hjälp av pilarna.","Klicka på OK.","Alternativ för häften","booklet_options.html");
Page[55]=new Array("En vattenstämpel är en bild eller en text som trycks under eller ovanpå text och bilder på sidorna i ett utskriftsjobb.","Obs! Inte alla operativsystem stöder utskrift av vattenstämpel.","Skapa en textvattenstämpel","Med en textvattenstämpel används den tecken som skrivits i fältet Text i vattenstämpeln. Du kan skapa en textvattenstämpel som ska skrivas ut på dokumentet. Välj alternativ för teckenstorlek, teckentyp, färg och vinkel.","Så här skapar du en textvattenstämpel:","Klicka på pilarna nedanför Vattenstämpel i fönstret Häfte/Vattenstämpel och välj Ny.","Klicka på Text i fönstret Redigering av vattenstämpel.","För text, använd vattenstämpelns namn eller skriv en ny text.","Du formaterar vattenstämpeln genom att klicka på Visa fonter och välja alternativ.","Du anger vattenstämpelns vinkel på sidan genom att skriva eller markera en procentsats eller använda reglaget.","Du anger vattenstämpelns placering på sidan genom att välja måttenhet och ange värdena för horisontell och vertikal position.","Du centrerar bilden på sidan genom att trycka på Centrera.","Klicka på OK.","Skapa en bildvattenstämpel","Vattenstämpeln kan bestå av en bild. Bildfilen kan ha något av formaten .bmp, .gif och .jpg. Du kan skapa en bildvattenstämpel som ska skrivas ut på dokumentet och välja alternativ för exempelvis storlek och placering på sidan.","Så här skapar du en bildvattenstämpel:","Klicka på pilarna nedanför Vattenstämpel i fönstret Häfte/Vattenstämpel och välj Ny.","Klicka på Bild i fönstret Redigering av vattenstämpel.","Skriv bildfilens sökväg och namn eller klicka på Välj bild och välj en befintlig bildfil. Filer med formatet .bmp, .jpg eller .gif kan väljas.","Ange önskad förstorings- eller förminskningsgrad för bilden om du vill ändra bildens skala.","Du kan förskjuta vattenstämpeln från sidans mitt genom att välja måttenheten och sedan ange värdena för horisontell och vertikal position.","Du centrerar bilden på sidan genom att trycka på Centrera.","Klicka på OK.","Redigera en vattenstämpel","Du kan redigera en vattenstämpel med hjälp av Redigering av vattenstämpel.","Så här redigerar du en vattenstämpel:","Klicka på pilarna nedanför Vattenstämpel i fönstret Häfte/Vattenstämpel och välj Redigera.","Ändra inställningarna i fönstret Redigering av vattenstämpel efter behov.","Klicka på OK.","Ta bort en vattenstämpel","Välj den vattenstämpel som ska raderas nedanför Vattenstämpel i fönstret Häfte/Vattenstämpel och klicka på Ta bort.","Klicka på Ja för att bekräfta borttagningen.","Redigering av vattenstämpel","watermark_editor.html");
Page[56]=new Array("Avancerade utskriftsalternativ ställs in i fönstret Avancerat. De val som görs i detta fönster tillämpas på alla jobb som skrivs ut med denna skrivardrivrutin.","För att se vilken skrivardrivrutinversion som har installerats, bläddra tills du är längst ner i fönstret.","Häftets bildordning","Välj ett alternativ bredvid Häftets bildordning i fönstret Avancerat.","Vänster till höger: layouten för Häften ställs in så att falsen hamnar till vänster i häftet när häftet falsas. Vänster till höger gäller textens läsriktning.","Med Höger till vänster anges häftets layout så att falsen hamnar till höger. Välj det här alternativet om du använder ett språk som läses från höger till vänster, till exempel arabiska eller farsi.","Rotera 180°","Klicka på pilarna bredvid Rotera bild 180 grader i fönstret Avancerat och ange ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","På eller Har aktiverats: Skrivaren kan rotera bilder 180 grader automatiskt. Skrivaren beaktar inställningarna av pappersformat, orientering, matningsorientering och valda efterbehandlingsalternativ när den roterar sidbilderna.","Av eller Har inaktiverats: Inaktiverar funktionen.","Jobbidentifiering","Klicka på pilarna bredvid Jobbidentifiering i fönstret Avancerat och ange ett alternativ.","Inaktivera jobb-ID: Hindrar att identifierande information om jobbet skrivs ut.","Skriv ut ID på försättsblad: ID-informationen skrivs ut på försättsbladet.","Skriv ut ID i marginaler - Endast första sida: Jobbidentifieringen skrivs ut på dokumentets första sida överst till vänster.","Skriv ut ID i marginaler - Alla sidor: Jobbidentifieringen skrivs ut överst till vänster på varje sida i dokumentet.","Utmatningsalternativ","Klicka på pilarna bredvid Utmatningsalternativ i fönstret Avancerat och ange ett alternativ.","Med Skrivarens grundinställda typ sker utskriften med den grundinställning som administratören har ställt in på skrivarens kontrollpanel.","Med Framsida upp och omvänd ordning matas sidorna ut med framsidan upp i fallande ordning (3, 2, 1).","Med Framsida ned (rekommenderas) matas sidorna ut med framsidan ned i fallande ordning (3, 2, 1).","Med Framsida upp matas sidorna ut med framsidan upp i stigande ordning (1, 2, 3).","Med Framsida ned och omvänd ordning matas sidorna ut med framsidan ned i fallande ordning (3, 2, 1).","Spegelvänd bild/Spegelvänd utskrift","Välj ett alternativ i fönstret Avancerat, bredvid Spegelvänd utskrift eller Spegelvänd bild.","Har aktiverats eller Ja: Vänder bilden på sidan från vänster till höger.","Har inaktiverats eller Nej: Stänger av Spegelvänd utskrift.","Negativ bild","Klicka på pilarna bredvid Negativ bild i fönstret Avancerat och ange ett alternativ.","Har aktiverats: Utskriften av ljusa respektive mörka områden sker omvänt.","Har inaktiverats: Stänger av Negativ bild.","Utkastläge","Klicka på pilarna bredvid Utkastbild i fönstret Avancerat och ange ett alternativ.","På eller Har aktiverats: Skriver ut utkast.","Av eller Har inaktiverats: Inaktiverar Utkastläge.","Jobbförskjutning/Begär satsförskjutning","Klicka på pilarna bredvid Jobbförskjutning/Begär satsförskjutning i fönstret Avancerat och ange ett alternativ.","Förskjut varje sats Varje sats i utskriften förskjuts.","Ingen förskjutning Utskrifter i flera exemplar förskjuts inte.","RGB neutral gråskala","Klicka på pilarna bredvid RGB neutral gråskala i fönstret Avancerat och ange ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Med Automatiskt svart används svart färgpulver för text och linjegrafik i svart och gråskala. Dessutom används sammansatt svart för delar i svart och gråskala i foton och grafik.","Sammansatt svart är en kombination av cyan, magenta och gult med svart.","Med Använd endast svart används svart färgpulver för alla områden i svart och gråskala, inklusive text, på sidan.","Med Använd sammansatt svart används sammansatt svart för områden i svart och gråskala i text, linjegrafik, foton och grafik.","Bildförbättring","Klicka på pilarna bredvid Bildförbättring i fönstret Avancerat och ange ett alternativ.","Med Automatiskt används fördefinierade inställningar som ger den bästa kompromissen mellan hastighet och kvalitet för varje utskriftsläge.","På innebär att alla tillgängliga alternativ används för att förbättra utskriftskvaliteten. Utskriften tar emellertid längre tid.","Av innebär att ingen bildförbättring används.","Svart överlagring/Överlagring","Klicka på pilarna bredvid Överlagring i fönstret Avancerat och ange ett alternativ.","På eller Har aktiverats: Gör att färgade områden överlappar kanterna på svarta områden. Inställningen påverkar inte vita områden.","Av eller Har inaktiverats: Inaktiverar funktionen.","Endast svart: Gör att färgade områden endast överlappar kanterna på svarta områden. Inställningen påverkar inte vita områden.","Rastrering/Använd skrivarens rastrering","Klicka på pilarna bredvid Använd skrivarens rastrering eller Rastrering i fönstret Avancerat och ange ett alternativ.","Låt programvaran hantera rastrering: du kan justera programmets rasterpunktmönster. Med den här inställningen simulerar du förhållanden såsom de som gäller när en lågupplösande tryckpress används. I den här inställningen används PostScript-drivrutinens rastrering, skrivarprogrammets rastrering eller bådadera när rastreringen skickas till skrivaren tillsammans med utskriftsjobbet.","Låt skrivaren hantera rastrering: den rastrering som är lagrad i skrivaren används.","Välj ett värde i menyn.","True Gray-grafik","Hoppa över tomma sidor","Klicka på pilarna bredvid Hoppa över tomma sidor i fönstret Avancerat och ange ett alternativ.","På: Hoppar över tomma sidor i en utskrift.","Av: Skriver ut tomma sidor i en utskrift.","Dekorfärger","Klicka på pilarna bredvid Dekorfärger i fönstret Avancerat och ange ett alternativ.","Med Låt programvaran hantera dekorfärger styr PostScript-drivrutinen, skrivarprogrammet eller båda konverteringen av dekorfärger till CMYK-färger inför utskrift. Använd den här inställningen när en viss dekorfärg inte skrivs ut i förväntad nyans.","Cyan, magenta, gult och svart (CMYK) som används för att framställa alla färger.","Med Låt skrivaren hantera dekorfärger optimeras konverteringen av dekorfärger till CMYK-färger inför utskrift.","Cyan, magenta, gult och svart (CMYK) som används för att framställa alla färger.","Bindningskant","Klicka på pilarna bredvid Bidningskant i fönstret Avancerat och ange ett alternativ.","Med Automatisk (rekommenderas) binds utskriften längs papperets lång- eller kortsida.","Med Bind längs långsida binds utskriften längs papperets långsida.","Med Bind längs kortsida binds utskriften längs papperets kortsida.","Glättningsnivå","Klicka på pilarna bredvid Glättningsnivå i fönstret Avancerat och ange ett alternativ.","Normal skriver ut en matt variant av den glättade originalbilden.","Med Förstärkt skrivs den glättade originalbilden ut två gånger. Utskriften går långsammare med det här alternativet.","Magasin 5 (manuellt), framkant","Klicka på pilarna bredvid Magasin 5 (manuellt), framkant i fönstret Avancerat och ange ett alternativ.","Med Auto val sker utskriften från ett godtyckligt magasin med papper av angivet format och angiven typ.","Långsidan först (normal) matar in papperets långsida först i skrivaren.","Kortsida först matar in papperets kortsida först i skrivaren. Använd den här inställningen när du skriver ut etiketter, häftar en annan del av sidan eller skriver ut på hålstansat papper.","Utskriftsoptimering","Klicka på Utskriftsoptimering och välj ett alternativ.","Optimera för ekonomi: Utskriften tar längre tid men färre förbrukningsartiklar går åt.","Optimera för hastighet: Utskriften går fortare men normal mängd förbrukningsartiklar används.","Upplösning","Klicka på pilarna bredvid Upplösning i fönstret Avancerat och ange ett alternativ för upplösning.","Förstärkning av tunna linjer","Klicka på pilarna bredvid Förstärkning av tunna linjer i fönstret Avancerat och ange ett alternativ.","På: Gör tunna linjer tjockare.","Av: Stänger av Förstärkning av tunna linjer.","Kompensera papper","Klicka på pilarna bredvid Kompensera papper i fönstret Avancerat och ange ett alternativ.","Har aktiverats: Sänker utskriftshastigheten för att utskriftsjobbet inte ska bli skrynkligt.","Har inaktiverats (rekommenderas): Inaktiverar funktionen Kompensera papper.","Avdelare","Redovisning","Dubbelriktad kommunikation","Avancerat","advanced.html");
Page[57]=new Array("Använd de avancerade alternativen för häfteslayout när du vill bestämma sidordningen i de utskrivna häftena. Använd Häftets bildordning när du vill ange häftesfalsning till vänster (Vänster till höger) eller till höger (Höger till vänster).","Obs! Den här funktionen är bara tillgänglig när Häften har aktiverats.","Så här väljer du alternativ för häftets bildordning:","Välj ett alternativ bredvid Häftets bildordning i fönstret Avancerat.","Vänster till höger: layouten för Häften ställs in så att falsen hamnar till vänster i häftet när häftet falsas. Vänster till höger gäller textens läsriktning.","Med Höger till vänster anges häftets layout så att falsen hamnar till höger. Välj det här alternativet om du använder ett språk som läses från höger till vänster, till exempel arabiska eller farsi.","Häftets bildordning","booklet_image_order.html");
Page[58]=new Array("När alternativet Rotera 180° har aktiverats vänds bilden på papperet så att överkanten hamnar nedåt. Orienteringen kan vara stående eller liggande.","Så här väljer du alternativ för Rotera 180°:","Klicka på pilarna bredvid Rotera bild 180 grader i fönstret Avancerat och ange ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","På eller Har aktiverats: Skrivaren kan rotera bilder 180 grader automatiskt. Skrivaren beaktar inställningarna av pappersformat, orientering, matningsorientering och valda efterbehandlingsalternativ när den roterar sidbilderna.","Av eller Har inaktiverats: Inaktiverar funktionen.","Rotera 180°","rotate_image.html");
Page[59]=new Array("Med Jobbidentifiering skrivs information om utskriften ut på en försättssida eller i marginalerna i dokumentet. Inställningarna som du gör här får effekt på alla utskrifter om de inte åsidosätts av Miljösmarta inställningar.","En försättssida är en avdelare som skrivs ut tillsammans med utskriften. Försättssidan inbegriper namnet på personen som skickade utskriften och namnet på dokumentet. När du använder en försättssida skrivs den ut före varje slutförd utskrift i utmatningsfacket. På vissa skrivare åsidosätts inställningen för försättssidan i skrivardrivrutinen av inställningen på kontrollpanelen.","Obs! ","Möjligheten att inaktivera försättssidor och aktivera jobb-ID-information i sidmarginalerna ingår i Miljösmarta inställningar.","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Så här väljer du alternativ för jobbidentifiering:","Klicka på pilarna bredvid Jobbidentifiering i fönstret Avancerat och ange ett alternativ.","Inaktivera jobb-ID: Hindrar att identifierande information om jobbet skrivs ut.","Skriv ut ID på försättsblad: ID-informationen skrivs ut på försättsbladet.","Skriv ut ID i marginaler - Endast första sida: Jobbidentifieringen skrivs ut på dokumentets första sida överst till vänster.","Skriv ut ID i marginaler - Alla sidor: Jobbidentifieringen skrivs ut överst till vänster på varje sida i dokumentet.","Jobbidentifiering","job_id.html");
Page[60]=new Array("Alternativet Utmatning styr hur dokumenten matas ut i skrivarens utmatningsfack. Vid normal utskrift matas dokumenten ut med framsidan ned i utmatningsfacket. Vissa pappersformat och papperstyper kan emellertid inte bearbetas på vanligt sätt och måste matas ut med framsidan upp. Det medför att vissa alternativ för efterbehandling och dubbelsidig utskrift inte är tillgängliga för sådana papperstyper.","Så här väljer du alternativ för utmatning:","Klicka på pilarna bredvid Utmatningsalternativ i fönstret Avancerat och ange ett alternativ.","Med Framsida ned (rekommenderas) matas sidorna ut med framsidan ned i fallande ordning (3, 2, 1).","Med Framsida upp matas sidorna ut med framsidan upp i stigande ordning (1, 2, 3).","Med Framsida ned och omvänd ordning matas sidorna ut med framsidan ned i fallande ordning (3, 2, 1).","Med Framsida upp och omvänd ordning matas sidorna ut med framsidan upp i fallande ordning (3, 2, 1).","Med Framsida ned och omvänd ordning matas sidorna ut med framsidan ned i fallande ordning (3, 2, 1).","Utmatningsalternativ","output_options.html");
Page[61]=new Array("Med Spegelvänd utskrift eller Spegelvänd bild skrivs bild och text ut spegelvänt på sidan. Resultatet liknar effekten när du tittar på en stordia från baksidan.","Så här väljer du alternativ för Spegelvänd utskrift eller Spegelvänd bild:","Välj ett alternativ i fönstret Avancerat, bredvid Spegelvänd utskrift eller Spegelvänd bild.","Har aktiverats eller Ja: Vänder bilden på sidan från vänster till höger.","Har inaktiverats eller Nej: Stänger av Spegelvänd utskrift.","Spegelvänd utskrift","mirrored_output.html");
Page[62]=new Array("Med Negativ bild sker utskriften med omvända ljusa och mörka områden i dokumentet, som om det vore ett fotonegativ. Det kan vara praktiskt att skriva ut en negativ bild av dokument med stora områden med mörk bakgrund eller ljus text och ljusa bilder. Svarta områden i originalet omvandlas till vita, vita områden omvandlas till svarta och mörkgrå områden omvandlas till ljusgrå.","Så här väljer du alternativ för Negativ bild:","Klicka på pilarna bredvid Negativ bild i fönstret Avancerat och ange ett alternativ.","Har aktiverats: Utskriften av ljusa respektive mörka områden sker omvänt.","Har inaktiverats: Stänger av Negativ bild.","Negativ bild","negative_output.html");
Page[63]=new Array("Utkastläge sparar färgpulver eller bläck men resulterar i bilder med sämre kvalitet.","Obs! Utkastläge ingår även i Miljösmarta inställningar.","Välja alternativ för Utkastläge:","Klicka på pilarna bredvid Utkastbild i fönstret Avancerat och ange ett alternativ.","På eller Har aktiverats: Skriver ut utkast.","Av eller Har inaktiverats: Inaktiverar Utkastläge.","Utkastläge","draft_mode.html");
Page[64]=new Array("Jobbförskjutning/Begär satsförskjutning styr hur exemplaren förskjuts i utskrifter med flera exemplar. När alternativet har aktiverats förskjuts exemplaren från varandra i utmatningsfacket. Detta alternativ förenklar sortering och hantering av dokument vid utskrift i flera exemplar. Alternativet är tillgängligt om utmatningsfacket har förskjutningsfunktion.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Välja alternativ för förskjutning:","Klicka på pilarna bredvid Jobbförskjutning/Begär satsförskjutning i fönstret Avancerat och ange ett alternativ.","Förskjut varje sats Varje sats i utskriften förskjuts.","Ingen förskjutning Utskrifter i flera exemplar förskjuts inte.","Jobbförskjutning/Begär satsförskjutning","offset.html");
Page[65]=new Array("Med RGB neutral gråskala kan du ange hur grått ska skrivas ut för att slippa tydliga färgstick.","Använda RGB neutral gråskala:","Klicka på pilarna bredvid RGB neutral gråskala i fönstret Avancerat och ange ett alternativ.","Skrivarens grundinställda typ: Aktuella skrivarinställningar används.","Med Automatiskt svart används svart färgpulver för text och linjegrafik i svart och gråskala. Dessutom används sammansatt svart för delar i svart och gråskala i foton och grafik.","Sammansatt svart är en kombination av cyan, magenta och gult med svart.","Med Använd endast svart används svart färgpulver för alla områden i svart och gråskala, inklusive text, på sidan.","Med Använd sammansatt svart används sammansatt svart för områden i svart och gråskala i text, linjegrafik, foton och grafik.","RGB neutral gråskala","rgb_neutral_gray.html");
Page[66]=new Array("Med Bildförbättring avgör skrivaren när Förstärk kanter, Förstärkning av tunna linjer, Förstärkning av svart eller Överlagring ska användas på en bild.","Så här väljer du alternativ för bildförbättring:","Klicka på pilarna bredvid Bildförbättring i fönstret Avancerat och ange ett alternativ.","Med Automatiskt används fördefinierade inställningar som ger den bästa kompromissen mellan hastighet och kvalitet för varje utskriftsläge.","På innebär att alla tillgängliga alternativ används för att förbättra utskriftskvaliteten. Utskriften tar emellertid längre tid.","Av innebär att ingen bildförbättring används.","Bildförbättring","image_enhancement.html");
Page[67]=new Array("Med Överlagring överlappar kanterna på färgade områden (utom vita) varandra och kanterna på svarta områden. Överlappningen bidrar till att kompensera för oregelbundenheter i utskriften som kan uppstå på grund av pappersförskjutningar eller andra problem.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Använda Överlagring:","Klicka på pilarna bredvid Överlagring i fönstret Avancerat och ange ett alternativ.","På eller Har aktiverats: Gör att färgade områden överlappar kanterna på svarta områden. Inställningen påverkar inte vita områden.","Av eller Har inaktiverats: Inaktiverar funktionen.","Endast svart: Gör att färgade områden endast överlappar kanterna på svarta områden. Inställningen påverkar inte vita områden.","Överlagring","trapping.html");
Page[68]=new Array("Rastrering är en utskriftsmetod som innebär att variationer i färg och ljusstyrka framställs genom bildpunkter (pixlar) i olika mörkhet, täthet och storlek. Detaljskärpan i den rastrerade bilden beror på antalet punkter per tum (dpi). Ju fler punkter per tum, desto större blir detaljskärpan i utskriften. Rastrering kallas ibland pixelering.","Obs! Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Välja alternativ för rastrering:","Klicka på pilarna bredvid Använd skrivarens rastrering eller Rastrering i fönstret Avancerat och ange ett alternativ.","Låt programvaran hantera rastrering: du kan justera programmets rasterpunktmönster. Med den här inställningen simulerar du förhållanden såsom de som gäller när en lågupplösande tryckpress används. I den här inställningen används PostScript-drivrutinens rastrering, skrivarprogrammets rastrering eller bådadera när rastreringen skickas till skrivaren tillsammans med utskriftsjobbet.","Låt skrivaren hantera rastrering: den rastrering som är lagrad i skrivaren används.","Välj ett värde i menyn.","Skrivarens rastrering/Rastrering","halftones.html");
