Page[79]=new Array("Med Redovisning kopplas ditt användarnamn och din kontoinformation till varje dokument som du skriver ut. Redovisningsdata samlas in och lagras när jobben skickas till skrivaren.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Beroende på dina inställningar för Redovisningssystem och Fråga vid redovisning kanske inte alla alternativ visas.","Konfigurera redovisning:","Klicka på pilarna bredvid Redovisningssystem i fönstret Redovisning och ange ett alternativ.","Xerox® Standardredovisning: Registrerar antalet kopieringar, utskrifter, skanningar och fax för varje användare. Funktionen använder användar-ID och konto-ID som har angetts i skrivaren.","Xerox® Nätverksredovisning: Hämtar användar-ID och konto-ID från behörighetsserver i nätverket.","Lokal redovisning: Kräver en redovisningskod för ditt undernät. Denna redovisningskod kan vara en faktureringskod för en avdelning, till exempel 0001. Övriga koder är valfria.","Avgiftsbelagd utskrift: Kräver ett fakturerings-ID för utskriftsjobb, till exempel din avdelnings fakturerings-ID. Övriga ID är valfria.","Skicka användar-ID och redovisnings-ID: Kräver att du anger användar-ID, redovisnings-ID och lösenord när du skickar ett utskriftsjobb.","Skicka endast användar-ID: Kräver att du anger användar-ID och lösenord när du skickar ett utskriftsjobb.","Skicka endast redovisnings-ID: Kräver att du anger redovisnings-ID och lösenord när du skickar ett utskriftsjobb.","Skicka endast fakturerings-ID: Kräver att du anger fakturerings-ID och lösenord när du skickar ett utskriftsjobb.","Skicka alla: Kräver att du anger användar-ID, redovisnings-ID, fakturerings-ID och lösenord när du skickar ett utskriftsjobb.","Välj ett alternativ bredvid Fråga vid redovisning.","Med Fråga alltid måste du ange ditt användar-ID och konto-ID varje gång du skickar ett utskriftsjobb.","Fråga inte använder informationen som du anger under Account Codes (Kontokoder) för alla utskriftsjobb.","Fråga endast vid fax: Kräver att du anger användar-ID och konto-ID varje gång du skickar ett fax.","Med Fråga endast vid färg behöver du bara ange ditt användar-ID och konto-ID för utskriftsjobb i färg.","Med Fråga bara för färg och fax behöver du bara ange ditt användar-ID och konto-ID för färgutskrifter och fax.","Om du vill dölja användar-ID, välj Maskera användar-ID. Asterisker * ersätter de tecken som skrivs i fältet.","Om du vill dölja konto-ID, välj Maskera konto-ID. Asterisker * ersätter de tecken som skrivs i fältet.","Ange värden efter behov under Grundinställda redovisningskoder. Dessa fält måste fyllas i när du väljer Fråga inte. Konto-ID och Fakturerings-ID kan vara en avdelningsbaserad faktureringskod, t.ex. 0001.","Klicka på OK.","Redovisning","accounting.html");
