Page[82]=new Array("Med Miljösmarta inställningar kan du minska miljöföroreningarna vid utskrift genom att minska förbrukningen av material och energi. Du kan välja Miljösmarta inställningar som grundinställning för alla utskriftsjobb. Klicka på knappen Miljösmarta inställningar om du vill hämta de miljösmarta inställningarna.","Den gröna knappen Miljösmarta inställningar finns längst ned i skrivardrivrutinen. Med den här knappen väljer du Miljösmarta inställningar för alla utskriftsjobb.","Obs! ","Alla alternativ som visas stöds inte på alla skrivare. Vissa alternativ finns bara i en viss skrivarmodell, en viss konfiguration, ett visst operativsystem eller en viss drivrutinstyp.","Om du ändrar Miljösmarta inställningar för ett utskriftsjobb som har skickats från ett program i datorn, ändras bara inställningarna för det aktuella jobbet. När du ändrar de miljösmarta inställningarna i drivrutinen ändras grundinställningarna för alla program.","Välja Miljösmarta inställningar:","Välj önskade alternativ i fönstret Miljösmarta inställningar.","Om du ska skriva ut varje jobb på båda sidorna av papperen, väljer du Ställ in dubbelsidig utskrift.","Dubbelsidig utskrift skriver ut på båda sidorna av papperet så att det kan bindas längs långsidan. Följande bilder visar resultatet med dokument med stående respektive liggande orientering:","@		@","Välj Provutskrift när du vill använda mindre papper och färgpulver eller bläck.","Med Provutskrift skrivs det ut ett exemplar av en utskrift innan resterande exemplar skrivs ut. När du har granskat provutskriften kan du skriva ut resterande exemplar eller ta bort dem via kontrollpanelen.","Om du vill skriva ut ett exemplar av ett utskriftsjobb som består av flera kopior och behålla övriga exemplar i skrivaren väljer du Ange Miljösmart provutskrift som Jobbtyp.","Om du vill förhindra att försättssidor skrivs ut tillsammans med varje utskrift väljer du Ingen försättssidaeller Inaktivera försättsark . Välj ett alternativ:","En försättssida är en avdelare som skrivs ut tillsammans med utskriften. Försättssidan inbegriper namnet på personen som skickade utskriften och namnet på dokumentet. När du använder en försättssida skrivs den ut före varje slutförd utskrift i utmatningsfacket. På vissa skrivare åsidosätts inställningen för försättssidan i skrivardrivrutinen av inställningen på kontrollpanelen.","Skriv inte ut jobb-ID: Hindrar att identifierande information om jobbet skrivs ut.","Skriv ut ID i marginaler - Endast första sida: Jobbidentifieringen skrivs ut på dokumentets första sida överst till vänster.","Skriv ut ID i marginaler - Alla sidor: Jobbidentifieringen skrivs ut överst till vänster på varje sida i dokumentet.","Välj Utkastläge eller Ange Utkast som Utskriftskvalitet när du vill spara färgpulver eller bläck genom att skriva ut med lägre kvalitet.","Klicka på OK.","Miljösmarta inställningar","earth_smart.html");
